class NavBar extends Component{

	render(){


		return(

		<div className="navbar-fixed">
		{props.country&&props.city&& <p>


			Location: 
		<span className='weather_value'>{props.city},{props.country}</span></p>}


		    <p>Welcome to </p>
  		</div>

			)
	}
}


